import React, { Component } from 'react';
import Todos from './components/Todos';

class App extends Component {
    state = {
        todos: [
            {
                id: 1,
                title: 'Pepepga',
                completed: false
            },
            {
                id: 2,
                title: 'Fak you ',
                completed: false
            },
            {
                id: 3,
                title: 'Kermit',
                completed: false
            },
        ]
    }

    render() {
        console.log(this.state.todos);
        return (
            <div className='App'>
                <Todos todos = {this.state.todos} />
            </div>
        );
    }
}

export default App;
